                i += len(sep_candidate)
                break

        if not found_sep_candidate:
            break

    j = len(s) - 1
    while j >= 0:
        found_sep_candidate = False

        for sep_candidate in characters:
            if s[j + 1 - len(sep_candidate):j+1] == sep_candidate:
                found_sep_candidate = True
                j -= len(sep_candidate)
                break

        if not found_sep_candidate:
            break

    return s[i:j+1]

