import sys

def main():
    n = input()
    char = input()

    colors = list(char)

    if len(colors) != int(n):
        print("No")
        return

    if len(colors) == 1:
        print("Yes")
        return

    temp = {}
    for i in colors:
        if i not in temp:
            temp[i] = 1
        else:
            temp[i] += 1

    return_val = "No"
    for color in temp:
        if temp[color] >= 2:
            return_val = "Yes"

    print(return_val)
    return

main()

